"use strict";(self.webpackChunkportfolio_site=self.webpackChunkportfolio_site||[]).push([[849],{86164:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"About","href":"/docs/About","docId":"About","unlisted":false},{"type":"category","collapsible":true,"label":"Vital Software Synthesizer","items":[{"type":"link","label":"Documentation Overview","href":"/docs/Vital/Overview","docId":"Vital/Overview","unlisted":false},{"type":"category","label":"Vital User Guide","collapsible":true,"items":[{"type":"link","label":"Introduction","href":"/docs/Vital/UserGuide/Intro","docId":"Vital/UserGuide/Intro","unlisted":false},{"type":"link","label":"Global Controls & Header Bar","href":"/docs/Vital/UserGuide/Global-Controls-and-Header-Bar","docId":"Vital/UserGuide/Global-Controls-and-Header-Bar","unlisted":false},{"type":"link","label":"Modulation","href":"/docs/Vital/UserGuide/Modulation","docId":"Vital/UserGuide/Modulation","unlisted":false},{"type":"link","label":"Oscillators & Sampler","href":"/docs/Vital/UserGuide/Oscillators-and-Sampler","docId":"Vital/UserGuide/Oscillators-and-Sampler","unlisted":false},{"type":"link","label":"Wavetable Editor","href":"/docs/Vital/UserGuide/Wavetable-Editor","docId":"Vital/UserGuide/Wavetable-Editor","unlisted":false},{"type":"link","label":"Filters","href":"/docs/Vital/UserGuide/Filters","docId":"Vital/UserGuide/Filters","unlisted":false},{"type":"link","label":"Envelopes & LFOs","href":"/docs/Vital/UserGuide/Envelopes-and-LFOs","docId":"Vital/UserGuide/Envelopes-and-LFOs","unlisted":false},{"type":"link","label":"Effects","href":"/docs/Vital/UserGuide/Effects","docId":"Vital/UserGuide/Effects","unlisted":false},{"type":"link","label":"Advanced","href":"/docs/Vital/UserGuide/Advanced","docId":"Vital/UserGuide/Advanced","unlisted":false}],"collapsed":true},{"type":"link","label":"Code Docs","href":"/docs/Vital/Vital-Code-Docs","docId":"Vital/Vital-Code-Docs","unlisted":false}],"collapsed":true},{"type":"category","label":"My Music","collapsible":true,"items":[{"type":"link","label":"Overview","href":"/docs/My-Pieces/Main","docId":"My-Pieces/Main","unlisted":false},{"type":"link","label":"Twelve Pieces for Piano (2024)","href":"/docs/My-Pieces/Twelve/","docId":"My-Pieces/Twelve/Twelve","unlisted":false}],"collapsed":true}]},"docs":{"About":{"id":"About","title":"About","description":"<img","sidebar":"tutorialSidebar"},"My-Pieces/Main":{"id":"My-Pieces/Main","title":"Overview","description":"Herein you can find links and additional information about music I\'ve written.","sidebar":"tutorialSidebar"},"My-Pieces/Twelve/Twelve":{"id":"My-Pieces/Twelve/Twelve","title":"Twelve Pieces for Piano (2024)","description":"The album is called \\"Twelve\\" and consists of 12 short piano pieces. There\'s no schema or anything relating the pieces together. The original impetus was to commemorate my 12th wedding anniversary on 12/12. I have provided the scores as download links below, so if you try to play any of them, please let me know in the YouTube comments\u2013I\'d love to hear it and/or just know that someone is playing my music!","sidebar":"tutorialSidebar"},"Vital/Overview":{"id":"Vital/Overview","title":"Documentation Overview","description":"Vital is a powerful, open-source spectral warping wavetable synthesizer created by Matt Tytel. However, it appears that no official documentation was provided\u2014either for end users or developers.","sidebar":"tutorialSidebar"},"Vital/UserGuide/Advanced":{"id":"Vital/UserGuide/Advanced","title":"Advanced","description":"The Advanced tab in Vital exposes global and oscillator-specific settings that fine-tune how the synth operates. These include oscillator unison configurations, global pitch/voice controls, quality (oversampling) settings, display preferences, and tuning options.","sidebar":"tutorialSidebar"},"Vital/UserGuide/Effects":{"id":"Vital/UserGuide/Effects","title":"Effects","description":"Vital provides a variety of effects that can be used to shape the sound of your patches. The effects can be added to the effects chain in the Effects tab:","sidebar":"tutorialSidebar"},"Vital/UserGuide/Envelopes-and-LFOs":{"id":"Vital/UserGuide/Envelopes-and-LFOs","title":"Envelopes & LFOs","description":"Envelopes","sidebar":"tutorialSidebar"},"Vital/UserGuide/Filters":{"id":"Vital/UserGuide/Filters","title":"Filters","description":"There are two filters on the Voice tab. Vital provides a wide variety of options including analog, digital, diode, formant, comb, and phaser filters. The filters can be used in series or parallel and can be modulated by various sources.","sidebar":"tutorialSidebar"},"Vital/UserGuide/Global-Controls-and-Header-Bar":{"id":"Vital/UserGuide/Global-Controls-and-Header-Bar","title":"Global Controls & Header Bar","description":"The following commands apply to knobs and sliders in Vital. These shortcuts are based on macOS and may differ on Windows or Linux.","sidebar":"tutorialSidebar"},"Vital/UserGuide/Intro":{"id":"Vital/UserGuide/Intro","title":"Introduction","description":"Vital is a \\"spectral warping wavetable synthesizer,\\" meaning it generates sound using }>wavetables and offers advanced tools for manipulating their harmonic content. One of Vital\'s most distinctive features is its Wavetable Editor, which provides a unique and powerful way to shape wavetables.","sidebar":"tutorialSidebar"},"Vital/UserGuide/Modulation":{"id":"Vital/UserGuide/Modulation","title":"Modulation","description":"Vital supports extensive modulation capabilities. You can modulate almost any parameter in the synth including using audio-rate modulation. The modulation sources include oscillators, LFOs, envelopes, random modulators, note modulators, and more. You can also drag-and-drop modulation sources onto modulation targets, assign modulators to MIDI controls, and edit the routing in the dedicated Matrix tab.","sidebar":"tutorialSidebar"},"Vital/UserGuide/Oscillators-and-Sampler":{"id":"Vital/UserGuide/Oscillators-and-Sampler","title":"Oscillators & Sampler","description":"There are three oscillators and one sampler module in Vital which appear on the Voice tab. These can be routed to the filters, effects, or directly to the main output. Additionally, they can modulate each other using Frequency Modulation or Ring Modulation.","sidebar":"tutorialSidebar"},"Vital/UserGuide/Wavetable-Editor":{"id":"Vital/UserGuide/Wavetable-Editor","title":"Wavetable Editor","description":"The wavetable editor is one of the key and most unique features of Vital. It allows you to create complex wavetables by graphically manipulating the waveform, harmonics, and phases.","sidebar":"tutorialSidebar"},"Vital/Vital-Code-Docs":{"id":"Vital/Vital-Code-Docs","title":"Code Docs","description":"The code docs are a work in progress. I spent a hefty amount of time generating Doxygen comments for the repo using ChatGPT (o1 model) and will update them as I become more familiar with the code base. So, take these with a grain of salt, as they need a lot of review and cleanup.","sidebar":"tutorialSidebar"}}}}')}}]);